import React from "react";


const Contact = (req, res) => {
    return (
        <div className="form">
            <form>
                <div>
                    <label htmlFor="name">Nom</label>
                    <input className="name" type="text" name="name" placeholder="Votre nom" />
                </div>
            </form>

        </div>
    )
}


export default Contact;
